import React, { useEffect } from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function GetData() {
  var formInfo = {
    username: "bill123",
    password: "1234"
  };

  useEffect(() => {
    fetch("http://localhost:3000/demo", { method: "POST", headers: { 'Content-type': "application/json" }, body: JSON.stringify(formInfo) })
      .then((res) => res.json())
      .then((data) => {console.log(data);})
      .catch((error) => {
        console.error(error);
      });
  }, []);

  return <div>Fetching data...</div>; 
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<GetData />);
